import React from "react";
import { Card } from "react-bootstrap";

const Print = (props) => {
  return (
    <div>
      <>
        <Card
          style={{ width: "13.8rem", border: `none`, marginBottom: `10px` }}
          clPrintName="card"
        >
          <Card.Img variant="top" src={props.printer.imgUrl} />
          <Card.Body>
            <Card.Title> {props.printer.name}</Card.Title>
            <Card.Text>
              <p>{props.printer.price}</p>
            </Card.Text>
          </Card.Body>
        </Card>
      </>
    </div>
  );
};

export default Print;
